import links from "../data/navigation";
import link from './Link'

function Header(props) {
    const linksElements = props.links.map((link) => {
    return <a href="#">{link}</a>
  })

    return (
      <header>
        <nav>
          {linksElements}
        </nav>
      </header>
    )
  }
  
  export default Header;
